import React from "react";
import NavBar from '../Components/navbar';
import "../Pages/pagestyle.css";

class FN extends React.Component {

  render() {
    return (
      <div>
      <NavBar/>
      <div class="fortnite">
       <font color="white" size="5"> Add a profile </font>
            <form class="submissionform">
              <div class="form-group">
                <label class='textcolor'>Username</label>
                <input type="text" class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter username"/>
              </div>
              <div class="form-group">
              	<label class='textcolor'>Profile Type</label>
              	<select class="form-control">
  					<option>Choose profile type</option>
  					<option>Personal</option>
  					<option>Friends</option>
			  	</select>
			  </div>
              <button type="submit" class="btn btn-primary">Submit</button>
            </form>
      </div>
     </div>
    );
  }
}

export default FN;
